@Override
public Collection<Node> getSubCells() {
  String[] hashes = GeohashUtils.getSubGeohashes(getGeohash());//sorted
  List<Node> cells = new ArrayList<Node>(hashes.length);
  for (String hash : hashes) {
    cells.add(new GhCell(hash));
  }
  return cells;
}

